import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

class NavBar extends React.Component{
    constructor(props){
        super(props)
    }

    render(){
        return (


      <nav className="navbar navbar-inverse navbar-fixed-top">
      <div className="container-fluid">
        <div className="navbar-header">
          <button type="button" className="navbar-toggle" data-toggle="collapse" data-target=".navbar-collapse">
            <span className="icon-bar" />
            <span className="icon-bar" />
            <span className="icon-bar" />                        
          </button>
          <a className="navbar-brand navbarText" href="./index.html">Stephen Doyle</a>
        </div>
        <div className="collapse navbar-collapse" id="myNavbar">
          <ul className="nav navbar-nav justify-content-center">
            <li className="nav-item" data-toggle="collapse" data-target=".navbar-collapse.show"><a href="./about.html" className="navbarText">About</a></li>
            <li className="nav-item" data-toggle="collapse" data-target=".navbar-collapse.show"><a href="./projects.html" className="navbarText">Projects</a></li>
            <li className="nav-item" data-toggle="collapse" data-target=".navbar-collapse.show"><a href="./articles.html" className="navbarText">Articles</a></li>
            <li className="nav-item" data-toggle="collapse" data-target=".navbar-collapse.show"><a href="./resources.html" className="navbarText">Resources</a></li>
            <li className="nav-item" data-toggle="collapse" data-target=".navbar-collapse.show"><a href="./contact.html" className="navbarText">Contact</a></li>
          </ul>
        </div>
      </div>
    </nav>
        )
    }
}

export default NavBar
